class CoHymnsKwizaChaMwene {
  static List<HymnsContent> list = [
    HymnsContent(id: 3724, position: 1, content: "Muze meza Mwene Yesu, \nMukutwala eswe, \nAna jenyi, ni manyinga \nWaalanjile", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3725, content: "Ngwe e matongonoshi, \nMwilu mahenyahenya;\nMuze hamwe ni Mwene,  \nMakatemuka.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_40, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3726, position: 2, content: "Anji makakunguluka. \nMu chifuchi chenyi; \nWaze a kutoma mbunge, \nNiumwe masala.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3727, position: 3, content: "Ana akepe ana akepe, \nA kwononokena; \nEno wa kwafwila Mwene, \nChamwenemwene.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_40, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3728, position: 1, content: "Muze che chitavwi memba,  \nNi mwaka muusulako, \nNi mu kucha che chimene mwilu tó; \nMuze kule mwe musali malikungulako, \nHa kutambikako, mungukapwako.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3729, content: "Muze maatambikako, \nNi mukanda mautanga, \nNi majina maatanga, \nHa kutambikako, mungukapwako.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_41, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3730, position: 2, content: "Kucha chize kwa kengulu  \nAfu muli K’Listu no \nNi uhenya makahindukilako; \nWaze atongwele Mwene \nmakakungulukamo, \nHa kutambikako, mungukapwako.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3731, position: 3, content: "Tukalingilenu Mwene  \nMwalwa ni ufuku pwi, \nSango lietu vumbi ni kuzanga ngwo, \nNdo we mwono muusula, ni \nmilimo hiyahwa, \nHa kutambikako, mungukapwako", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_41, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3732, position: 1, content: "Meso ni meso ni Yesu, \nChilamwina chami Iye; \nKumumona ngunafupu, \nMumu wangufwilile.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3733, content: "Meso ni meso ni Mwene, \nMu chifuchi cha mwilu; \nMu uhenya wenyi weswe \nMungukamoma Yesu.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_42, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3734, position: 2, content: "Haliapwila chahashile \nKumumona kanawa; \nAlioze tangwa lize. \nMasoloka zwalala.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3735, position: 3, content: "Muze mwilu hamwe nenyi, \nMunguwahililamo, \nMumu yuma yeswe yipi \nChichi kayimonako.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3736, position: 4, content: "Meso ni meso kumona \nYoze wangukulile; \nMwilu mungumunyingika, \nYoze kananguzange.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_42, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3737, position: 1, content: "Muze meza Mwene wetu, \nMutukakungamako, \nMu uhenya ni mwe K’Listu, \nMutukakungamako,", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3738, content: "Mutukakungama mwilu, \nMu uhenya, mu uhenya mwilu; \nMutukakungama mwilu, \nKumeso já Mwene wetu.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_43, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3739, position: 2, content: "Mutupwa matangwa eswe \nHamwe ni Yesu Mwene; \nKechi kalihandunuma,\nNdo ku miaka yeswe.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3740, position: 3, content: "Ndo Mwene mutumumona, \nMutumbata yilemu; \nVumbi lienyi mulilita, \nMba mutuheta mwilu.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3741, position: 4, content: "Mba kulutwe lia kashimbu \nMwilu mutukapwamo, \nMwene wetu kumakeza, \nMeza kutuchizaho.", hymnsNumber: CoHymnsNumberSeeder.KWIZA_CHA_MWENE_43, typeStanza: HymnsContentCode.VERSE),
  ];
}